%[text] %[text:anchor:T_ACBBE461] # Control Flow
%[text] %[text:anchor:H_E532EA92] ## If, Else Statement
%[text] ![](text:image:2a89)
%[text] - Uses logical operations to determine which statement to execute
%[text] - Any logical operation OR anything that can be resolved to TRUE or FALSE can be used as conditional statement \
%%
%[text] %[text:anchor:H_170690D6] ## Example - IF ELSE
%[text] %[text:anchor:H_9CC48C7B] Create an IF, ELSE statement based on the following pseudocode:
%[text] 1. Assign an integer to the variable *x*
%[text] 2. If the x is ODD, display 'x is odd'
%[text] 3. Else display 'x is even' \
%[text] NOTES:
%[text] - You should use **mod** to see if it is divisible by 2
%[text] - The output from **mod** can be typecast into a conditional statement \
%[text] ADVANCED
%[text] - Inside the IF, ELSE statement, just set a string *s* to 'even' or 'odd'
%[text] - Use fprintf to report the final outcome (after the IF ELSE statement) \
x = 5
if mod(x,2)
    s = 'odd';
else
    s = 'even';
end
fprintf('x is %s',s)
%[text] - notice only one of two statements is executed
%[text] - What happens if you remove the relational operation? (==0)? Does it still work? Why?  \
%%
%[text] %[text:anchor:H_ECCA6AD8] ## IF, ELSEIF Statement
%[text] ![](text:image:23ab)
%[text] - If you have more than one conditional statement to test, add IF ELSE statements
%[text] - Each conditional statement will be tested sequentially
%[text] - This means that if TWO conditional statements resolve to TRUE, only the first conditional statement will be executed \
%%
%[text] %[text:anchor:H_422D0EAF] ## Example - ELSEIF
%[text] %[text:anchor:H_32B775CB] ![](text:image:8dc3)
%[text] %[text:anchor:H_5CEF7C57] Blackjack, a popular casino game is deceptively simple. Just get a higher score than the dealer, but don't go over 21. 
%[text] When playing Black Jack, you are dealt two cards and then asked whether you want any more cards. Its your job to decide whether you want another card (Hit me!) or you just want to stick with what you have ('Hold.')
%[text] Here we will use the function **randi** to simulate a black jack hand, with a range of values from 2 (the minimal value you can get with 2 cards) to 30 (if you're foolish enough to hit on a 20).
hand = randi([2 30],1,1) % simulate a hand ranging from 2 to 30 %[output:8eb46c59]

if hand > 21 % if greater than 21
    s =  'Ooh, bust. Pay up.';
elseif hand==21 % if equal to 21
    s = 'Black Jack!!!';
    beep
elseif hand >= 16 % Hold at 16 or higher
    s = 'Would you like to hold?';
else
    s = 'Hit?';
end
fprintf('%d. %s', hand,s) %[output:5edba436]
%[text] - How would you add a statement asking 'Would you like to double down?' if you get a 10 OR an 11?
%[text] - Does the order of the statements matter?
%[text] - How would you add the total of the hand to the reported statement? \
%[text] 
%%
%[text] %[text:anchor:H_BC23E8B3] ## Switch Case
%[text] ![](text:image:829b)
%[text] - ONLY tests for equality, not other operations
%[text] - You don’t explicit set up a conditional statement - the conditional statement is implied (IS EQUAL TO)
%[text] - You can have as many case statements as you want
%[text] - The comparison doesn’t have to be a character array
%[text] - You can even mix and match character arrays and numbers \
%[text] %[text:anchor:H_6D91EE28] ## Example - SWITCH CASE
%[text] - match a color \
%answer = inputdlg('Enter a color:'); % dialog box to request data
answer = "yellow" %[control:dropdown:2f89]{"position":[10,18]}

switch answer{:} % answer =  cell array - {} opens element to access content
    case 'red'
        str = 'Roses are red';
    case 'green'
        str = 'Stems are green';
    case 'blue' 
        str = 'Violets are blue';
    case 'magenta'
        str = 'Magenta is Magnificent!'
    case {'orange', 'yellow'}
        str = 'Orange you glad you chose yellow (or orange)'
    otherwise
        str = 'try again';
end
fprintf('%s', str)
%[text] Try it now: 
%[text] - Run the code section
%[text] - Explore the workspace: examine *answer* and *str* \
%[text] Next:
%[text] - add a new case for magenta. set  *str*  be 'Magenta is Magnificent'
%[text] - add a new case for cyan: set *str to* 'Cyan is cool!'
%[text] - add a new case for either 'orange' or 'yellow'. Note, case statements can be cell arrays: set *str* to 'Orange you glad you chose yellow (or orange)'
%[text] - Test your code. Did it work? \
%[text] Finally: 
%[text] - Comment out the first line of code
%[text] - Add a new line of code that contains drop down menu (Under the insert field) and add all of the potential colors there. That way you don't have to worry about proper capitalization or misspellings. Make sure the drop down menu assigns the variable *answer* \
